import React from 'react';

const XAILogo = ({ sx = {} }) => (
  <img 
    src="/xai-logo.png" // Make sure to add this image to your public folder
    alt="XAI Logo"
    style={{
      width: sx.fontSize || '24px',
      height: sx.fontSize || '24px',
      ...sx
    }}
  />
);

export default XAILogo;
